

DROP TABLE IF EXISTS `TEST_TABLE`;
CREATE TABLE IF NOT EXISTS `TEST_TABLE` (
  `ID` char(36) NOT NULL,
  `TEST_NAME` varchar(50) NOT NULL,
  `CREATED_BY` varchar(50) NOT NULL,
  `CREATED_ON` bigint(20) NOT NULL,
  `LAST_UPDATED_BY` varchar(50) DEFAULT NULL,
  `LAST_UPDATED_ON` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `TEST_TABLE_UN` (`TEST_NAME`)
) ENGINE=InnoDB;




DROP TABLE IF EXISTS `COMMAND`;
CREATE TABLE IF NOT EXISTS `COMMAND` (
  `ID` char(36) NOT NULL,
  `NAME` varchar(100) NOT NULL COMMENT 'Name of the command',
  `DESCRIPTION` varchar(200) DEFAULT NULL COMMENT 'Description of the command',
  `EXECUTION_SEQUENCE` int(36) NOT NULL COMMENT 'Command sequence id',
  `PROCESS` varchar(100) NOT NULL COMMENT 'Name of the command',
  `ACTIVE` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Active flag',
  `CREATED_BY` char(36) NOT NULL,
  `CREATED_ON` bigint(20) NOT NULL,
  `LAST_UPDATED_BY` char(36) DEFAULT NULL,
  `LAST_UPDATED_ON` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `UN_COMMAND_SEQUENCE` (`NAME`,`PROCESS`)
)ENGINE=InnoDB;


